oekt, slaan we een tijdelijke cookie op om te controleren of je browser cookies accepteert. Deze cookie bevat geen persoonlijke gegevens en wordt verwijderd zodra je je browser sluit.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Zodra je inlogt, zullen we enkele cookies bewaren in verband met jouw login informatie en schermweergave opties. Login cookies zijn 2 dagen geldig en cookies voor schermweergave opties 1 jaar. Als je &quot;Herinner mij&quot; selecteert, wordt je login 2 weken bewaard. Zodra je uitlogt van jouw account, worden login cookies verwijderd.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Wanneer je een bericht wijzigt of publiceert wordt een aanvullende cookie door je browser opgeslagen. Deze cookie bevat geen persoonlijke data en heeft enkel het post ID van het artikel wat je hebt bewerkt in zich. Deze cookie is na een dag verlopen.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Ingesloten inhoud van andere websites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Berichten op deze site kunnen ingesloten (embedded) inhoud bevatten (bijvoorbeeld video\'s, afbeeldingen, berichten, etc.). Ingesloten inhoud van andere websites gedraagt zich exact hetzelfde alsof de bezoeker deze andere website heeft bezocht.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Deze websites kunnen data over jou verzamelen, cookies gebruiken, tracking van derde partijen insluiten en je interactie met deze ingesloten inhoud monitoren, inclusief de interactie met ingesloten inhoud als je een account hebt en ingelogd bent op die website.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Analytics</h3><!-- /wp:heading --><!-- wp:heading --><h2>Met wie we jouw gegevens delen</h2><!-- /wp:heading --><!-- wp:heading --><h2>Hoe lang we jouw gegevens bewaren</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Wanneer je een reactie achterlaat dan wordt die reactie en de metadata van die reactie voor altijd bewaard. Op deze manier kunnen we vervolgreacties automatisch herkennen en goedkeuren in plaats van dat we ze moeten modereren.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Voor gebruikers die zich op onze site registreren (indien aanwezig), slaan we ook de persoonlijke informatie op die ze verstrekken in hun gebruikersprofiel. Alle gebruikers kunnen op ieder moment hun persoonlijke informatie bekijken, bewerken of verwijderen (behalve dat ze hun gebruikersnaam niet kunnen wijzigen). Site beheerders kunnen deze informatie ook bekijken en bewerken.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Welke rechten je hebt over je gegevens</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Als je een account hebt op deze site of je hebt reacties achter gelaten, kan je verzoeken om een exportbestand van je persoonlijke gegevens die we van je hebben, inclusief alle gegevens die je ons opgegeven hebt. Je kan ook verzoeken dat we alle persoonlijke gegevens die we van je hebben verwijderen. Dit bevat geen gegevens die we verplicht moeten bewaren in verband met administratieve, wettelijke of beveiligings doeleinden.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Waar we jouw gegevens naartoe sturen</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Mogelijk worden reacties van bezoekers gecontroleerd via een geautomatiseerde spamdetectie service.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Jouw contactinformatie</h2><!-- /wp:heading --><!-- wp:heading --><h2>Aanvullende informatie</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Hoe we jouw gegevens beschermen</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Welke datalek procedures we gemplementeerd hebben</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Van welke derde partijen we gegevens ontvangen</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Wat voor geautomatiseerde besluiten we nemen en profilering we doen met gebruikersgegevens</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Openbaarmakingsverplichtingen van de industrie</h3><!-- /wp:heading -->", "Privacybeleid", "", "inherit", "closed", "closed", "", "3-revision-v1", "", "", "2020-07-13 09:38:53", "2020-07-13 09:38:53", "", "3", "http://localhost:8888/wordpress/2020/07/13/3-revision-v1/", "0", "revision", "", "0");
INSERT INTO `wp_posts` VALUES("12", "1", "2020-07-13 09:47:51", "2020-07-13 09:47:51", "<h1>Bouwbedrijf de Vries</h1>\n			<h2>Diensten</h2>		\n        <img src=\"https://www.debouwcombinatienc.nl/wp-content/uploads/2018/12/aanbouw.jpg\" />\n        <h3>Stukadoor</h3>\n        <img src=\"https://www.debouwcombinatienc.nl/wp-content/uploads/2018/12/aanbouw.jpg\" />\n        <h3>Timmerwerk</h3>\n        <img src=\"https://www.debouwcombinatienc.nl/wp-content/uploads/2018/12/aanbouw.jpg\" />\n        <h3>Schilderwerk</h3>\n			<a href=\"/wordpress/werkzaamheden\" role=\"button\">\n						Bekijk alle diensten\n					</a>\n			<h2>Offerte aanvragen</h2>		\n		<p>Wilt u werk door ons laten uitvoeren? Vraag<b>vrijblijvend</b>een offerte aan. Binnen 1-2 werkdagen, ontvangt u een op maat gemaakte offerte. U kunt ook bellen met vragen naar<b>06-43499341</b>of mail naar <b>sales@bouwbedrijfdevries.nl</b></p><ul><li>Persoonlijk advies op maat</li><li>Duidelijke offerte en een<b>vaste</b>prijs</li><li>Deadlines worden afgesproken: zo weet u waar u aan toe bent</li><li>Wij zijn uw<b>enige aanspreekpunt</b>tijdens een project</li><li>Al uw wensen zijn uitvoerbaar</li></ul>		\n<form action=\"/wordpress/wp-admin/admin-ajax.php#wpcf7-f74-o1\" method=\"post\" novalidate=\"novalidate\">\n<input type=\"hidden\" name=\"_wpcf7\" value=\"74\" />\n<input type=\"hidden\" name=\"_wpcf7_version\" value=\"5.2\" />\n<input type=\"hidden\" name=\"_wpcf7_locale\" value=\"nl_NL\" />\n<input type=\"hidden\" name=\"_wpcf7_unit_tag\" value=\"wpcf7-f74-o1\" />\n<input type=\"hidden\" name=\"_wpcf7_container_post\" value=\"0\" />\n<input type=\"hidden\" name=\"_wpcf7_posted_data_hash\" value=\"\" />\n<p><label> Uw naam (verplicht)<br />\n    <input type=\"text\" name=\"your-name\" value=\"\" size=\"40\" aria-required=\"true\" aria-invalid=\"false\" /> </label></p>\n<p><label> Uw e-mail adres (verplicht)<br />\n    <input type=\"email\" name=\"your-email\" value=\"\" size=\"40\" aria-required=\"true\" aria-invalid=\"false\" /> </label></p>\n<p><label> Onderwerp<br />\n    <input type=\"text\" name=\"your-subject\" value=\"\" size=\"40\" aria-invalid=\"false\" /> </label></p>\n<p><label> Uw bericht<br />\n    <textarea name=\"your-message\" cols=\"40\" rows=\"10\" aria-invalid=\"false\"></textarea> </label></p>\n<p><input type=\"submit\" value=\"Verzenden\" /></p>\n</form>", "Home", "", "publish", "closed", "closed", "", "tweede-pagina", "", "", "2020-07-16 19:17:30", "2020-07-16 19:17:30", "", "0", "http://localhost:8888/wordpress/?page_id=12", "0", "page", "", "0");
