INSERT INTO `wp_posts` VALUES("19", "1", "2020-07-13 10:29:01", "2020-07-13 10:29:01", "<!-- wp:paragraph -->\r\n<p>Dit is een voorbeeldpagina. Het is anders dan een blog bericht omdat het op n plek blijft en tevoorschijn komt in je site navigatie (in de meeste thema\'s). De meeste mensen starten met een Over pagina dat hen voorstelt aan potentile site bezoekers. Het zou iets als dit kunnen zeggen:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\">\r\n<p>Hoi daar! Ik ben een fietskoerier in het dagelijks leven en een beginnende acteur in de avonduren. Ik leef in Los Angeles, heb een leuke hond genaamd Jack en ik hou van pia coladas. (En overvallen worden door de regen.)</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>...of zoiets als dit:</p>\r\n<!-- /wp:paragraph -->\r\n\r\n<!-- wp:quote -->\r\n<blockquote class=\"wp-block-quote\">\r\n<p>De XYZ Doohickey Company is opgericht in 1971 en heeft sindsdien kwalitatieve doohickeys aan het publiek geleverd. Gevestigd in Gotham City, XYZ heeft meer dan 2000 mensen in dienst en doen allemaal fantastische dingen voor de community in Gotham.</p>\r\n</blockquote>\r\n<!-- /wp:quote -->\r\n\r\n<!-- wp:paragraph -->\r\n<p>Als nieuwe WordPress gebruiker kan je naar <a href=\"http://localhost:8888/wordpress/wp-admin/\">je dashboard</a> gaan om deze pagina te verwijderen en nieuwe pagina\'s toe te voegen voor je inhoud. Veel plezier!</p>\r\n<!-- /wp:paragraph -->", "Projecten", "", "inherit", "closed", "closed", "", "2-revision-v1", "", "", "2020-07-13 10:29:01", "2020-07-13 10:29:01", "", "2", "http://localhost:8888/wordpress/2020/07/13/2-revision-v1/", "0", "revision", "", "0");
